class BackgroundImageFrame(QFrame):
    def __init__(self, parent=None):
        super().__init__(parent)
        self.pixmap = QPixmap()
        if BACKGROUND_IMAGE_DATA:
            self.pixmap.loadFromData(base64.b64decode(BACKGROUND_IMAGE_DATA))

    def paintEvent(self, event):
        painter = QPainter(self)
        painter.setRenderHint(QPainter.RenderHint.Antialiasing)

        path = QPainterPath()
        path.addRoundedRect(QRectF(self.rect()), 25.0, 25.0)
        painter.setClipPath(path)

        if not self.pixmap.isNull():
            scaled_pixmap = self.pixmap.scaled(
                self.size(),
                Qt.AspectRatioMode.KeepAspectRatioByExpanding,
                Qt.TransformationMode.SmoothTransformation,
            )
            painter.drawPixmap(self.rect(), scaled_pixmap)
        else:
            painter.setBrush(QBrush(QColor("#232433")))
            painter.setPen(Qt.PenStyle.NoPen)
            painter.drawRect(self.rect())

        super().paintEvent(event)


class DownloadWorker(QObject):
    progress = pyqtSignal(str)
    finished = pyqtSignal()
    error = pyqtSignal(str)

    def __init__(self, url, ffmpeg_path=None):
        super().__init__()
        self.url = url
        self.ffmpeg_path = ffmpeg_path
        self.process = None

    def run(self):
        if not self.url:
            self.error.emit("Hata: Ltfen geerli bir Spotify Playlist URL'si girin.")
            return
        self.progress.emit(f"ndirme balatlyor: {self.url}\n")
        command = [
            "spotdl",
            self.url,
            "--output",
            "downloaded-musics/{title} - {artist}.{ext}",
        ]
        if self.ffmpeg_path and os.path.exists(self.ffmpeg_path):
            command.extend(["--ffmpeg", self.ffmpeg_path])
        else:
            self.progress.emit(
                "Uyar: FFmpeg bulunamad. spotdl sistemdeki FFmpeg'i arayacak.\n"
            )
        try:
            self.process = subprocess.Popen(
                command,
                stdout=subprocess.PIPE,
                stderr=subprocess.STDOUT,
                text=True,
                encoding="utf-8",
                creationflags=(
                    subprocess.CREATE_NO_WINDOW if platform.system() == "Windows" else 0
                ),
            )
            for line in iter(self.process.stdout.readline, ""):
                self.progress.emit(line.strip())
            self.process.wait()
            if self.process.returncode == 0:
                self.progress.emit("\nndirme baaryla tamamland!")
                self.finished.emit()
            else:
                self.error.emit(
                    f"\nlem bir hata ile sonland (Kod: {self.process.returncode})."
                )
        except FileNotFoundError:
            self.error.emit("Hata: 'spotdl' komutu bulunamad. Kurulumu kontrol edin.")
        except Exception as e:
            self.error.emit(f"Beklenmedik bir hata olutu: {e}")


class SpotifyDownloader(QWidget):
    def __init__(self):
        super().__init__()
        self.drag_pos = QPoint()
        self.download_thread = None
        self.download_worker = None
        self.setup_ui()

    def create_svg_icon(self, b64_data):
        pixmap = QPixmap()
        pixmap.loadFromData(base64.b64decode(b64_data))
        return QIcon(pixmap)

    def setup_ui(self):
        self.setWindowTitle("Spotify Playlist Downloader")
        self.setWindowFlags(Qt.WindowType.FramelessWindowHint)
        self.setAttribute(Qt.WidgetAttribute.WA_TranslucentBackground)
        self.setFixedSize(800, 450)
        self.setWindowIcon(self.create_svg_icon(LOGO_ICON_DATA))

        self.main_layout = QVBoxLayout(self)
        self.main_layout.setContentsMargins(0, 0, 0, 0)
        self.background_frame = BackgroundImageFrame(self)
        self.background_frame.setObjectName("backgroundFrame")
        self.main_layout.addWidget(self.background_frame)

        self.frame_layout = QVBoxLayout(self.background_frame)
        self.frame_layout.setContentsMargins(25, 10, 25, 25)
        self.frame_layout.setSpacing(10)

        self.title_bar = QWidget()
        self.title_bar_layout = QHBoxLayout(self.title_bar)
        self.title_bar_layout.setContentsMargins(0, 0, 0, 0)
        self.title_bar.setFixedHeight(60)

        logo_label = QLabel(self)
        logo_pixmap = QPixmap()
        logo_pixmap.loadFromData(base64.b64decode(LOGO_ICON_DATA))
        logo_label.setPixmap(
            logo_pixmap.scaled(
                41,
                41,
                Qt.AspectRatioMode.KeepAspectRatio,
                Qt.TransformationMode.SmoothTransformation,
            )
        )

        title_label = QLabel("Spotify Playlist Downloader")
        title_label.setObjectName("titleLabel")

        self.minimize_button = QPushButton(self)
        self.minimize_button.setObjectName("minimizeButton")
        self.minimize_button.setIcon(self.create_svg_icon(MINIMIZE_ICON_DATA))
        self.minimize_button.setIconSize(QSize(12, 12))
        self.minimize_button.clicked.connect(self.showMinimized)

        self.close_button = QPushButton(self)
        self.close_button.setObjectName("closeButton")
        self.close_button.setIcon(self.create_svg_icon(CLOSE_ICON_DATA))
        self.close_button.setIconSize(QSize(12, 12))
        self.close_button.clicked.connect(self.close)

        self.title_bar_layout.addWidget(
            logo_label, alignment=Qt.AlignmentFlag.AlignVCenter
        )
        self.title_bar_layout.addSpacing(1)
        self.title_bar_layout.addWidget(
            title_label, alignment=Qt.AlignmentFlag.AlignVCenter
        )
        self.title_bar_layout.addStretch()
        self.title_bar_layout.addWidget(
            self.minimize_button, alignment=Qt.AlignmentFlag.AlignVCenter
        )
        self.title_bar_layout.addSpacing(5)
        self.title_bar_layout.addWidget(
            self.close_button, alignment=Qt.AlignmentFlag.AlignVCenter
        )

        self.url_input = QLineEdit()
        self.url_input.setPlaceholderText("Spotify Playlist URL'sini giriniz...")
        self.url_input.setFixedHeight(55)
        self.url_input.returnPressed.connect(self.start_download)

        status_label_container = QHBoxLayout()
        status_label = QLabel("STATUS")
        status_label.setObjectName("statusLabel")
        status_label_container.addStretch()
        status_label_container.addWidget(status_label)
        status_label_container.addStretch()

        self.status_output = QTextEdit()
        self.status_output.setReadOnly(True)
        self.status_output.setObjectName("statusOutput")

        self.open_folder_button = QPushButton("Klasr A")
        self.open_folder_button.setObjectName("folderButton")
        self.open_folder_button.setCursor(QCursor(Qt.CursorShape.PointingHandCursor))
        self.open_folder_button.clicked.connect(self.open_downloads_folder)

        bottom_button_container = QHBoxLayout()
        bottom_button_container.addStretch()
        bottom_button_container.addWidget(self.open_folder_button)
        bottom_button_container.addStretch()

        self.frame_layout.addWidget(self.title_bar)
        self.frame_layout.addStretch(1)
        self.frame_layout.addWidget(self.url_input)
        self.frame_layout.addSpacing(15)
        self.frame_layout.addLayout(status_label_container)
        self.frame_layout.addSpacing(-3)
        self.frame_layout.addWidget(self.status_output, 5)
        self.frame_layout.addStretch(1)
        self.frame_layout.addLayout(bottom_button_container)

        self.apply_styles()

